import React, { useState } from 'react'
import "../listProduct/listProduct.css"
// !product list
import { Productlist, Detailproduct, Testimonials } from "../dataProduct/dataProduct.js"
import Row from "react-bootstrap/Row"
import Col from 'react-bootstrap/Col'
import Card from 'react-bootstrap/Card'
import Container from 'react-bootstrap/Container'
import Button from 'react-bootstrap/esm/Button'
import { AiFillCloseCircle } from "react-icons/ai"
import Img from "../asset/box6.jpg"

const ListProductHere = () => {
    // !useState
    const [Menudata, setMenudata] = useState(Productlist)
    const [showpopup, setshowpopup] = useState(false)
    const [Popup, setPopup] = useState("")
    const [dataProductQ, setdataProductQ] = useState(Detailproduct)
    const [detailProductIndex, setdetailProductIndex] = useState(0)
    //*this modal usestate
    const [showTestimonial, setshowTestimonial] = useState(false)
    const [detailTestimonial, setdetailTestimonial] = useState(Testimonials)
    const [setTestionial, setTestimonial] = useState("")


    const PopupTrue = (Index) => {
        setshowpopup(true)
        setdetailProductIndex(Index)
        setPopup(Menudata[Index].HelloCus)

    }


    const handleTestimonial = (Index) => {
        setshowTestimonial(true);
        setdetailTestimonial(Index);
        setTestimonial(detailTestimonial[setdetailTestimonial].Saycustomers)
    }

    return (
        <>
            <section id="product">
                <div className="section_text">
                    <h4>ðŸŒ»List <span className='Product-text'>productðŸŒ»</span></h4>
                    <div className="subtitle_text">berikut product kami bestie yang sudah terjual</div>
                    <br />
                    <br />
                </div>

                <Container>
                     //!This is modal Detail
                    <div className="popups">
                        {showpopup && dataProductQ.map((ProductQ, i) => (
                            <div className="popup" key={i}>
                                <div className="popup-content">
                                    <div className="close-butons">
                                        <Button
                                            variant="secondary"
                                            className="close-button"
                                            onClick={() => setshowpopup(false)}
                                        >
                                            <AiFillCloseCircle />
                                        </Button>
                                    </div>

                                    <p>{Popup}</p>
                                    <Card.Body>
                                        <Card.Img
                                            variant="top"
                                            src={Img}
                                            style={{ width: "18rem" }}
                                            alt=""
                                        />
                                        <Card.Title>{dataProductQ[detailProductIndex].namaBarang}</Card.Title>
                                        <Card.Text>{dataProductQ[detailProductIndex].bahan}</Card.Text>
                                    </Card.Body>

                                </div>
                            </div>
                        ))

                        }

                    </div>
                    <Row xs={1} md={4} className="g-3   justify-content-md-center" >
                        {
                            Menudata.map((product, i) => (
                                <Col xs={12} sm={6} md={4} lg={3}  >
                                    <div className="card-plus">
                                        <Card style={{ width: "100%" }} key={i}>
                                            <div className="card">
                                                <Card.Img
                                                    variant="top"
                                                    src={product.img}
                                                    alt=""
                                                />
                                                <Card.Body>
                                                    <Card.Title>{product.nama}</Card.Title>
                                                    <Card.Text>
                                                        {product.price}
                                                    </Card.Text>
                                                    <Button variant="primary"
                                                        className='text-box'
                                                        href="#"
                                                        onClick={() => {
                                                            PopupTrue(i)
                                                        }}
                                                    >detail product</Button>
                                                    <Button variant="primary m-2"
                                                        href='#'
                                                        onClick={() => handleTestimonial}
                                                    >Testimonial</Button>
                                                </Card.Body>
                                            </div>

                                        </Card>

                                    </div>
                                </Col>
                            ))
                        }
                    </Row>
                </Container>
            </section>
            {/* </div> */}


        </>
    )
}

export default ListProductHere
